(928, 1, 'DERMAXIN CHAMPÚ', '', '<p style=\"margin-top: 0rem; margin-bottom: 1rem; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<span style=\"font-weight: 700;\">DERMAXIN CHAMP&Uacute;,</span>&nbsp;es un champ&uacute; de alta calidad, con PH neutro y a base de aceites esenciales, para el cuidado de pieles irritadas que necesiten un cuidado especial. Ideal para pieles secas, escamosas, sensibles y con picores. Aporta las propiedades de las plantas con un agradable aroma, resultando un complemento perfecto de Dermaxin Pomada.&nbsp;</p>\r\n<p style=\"margin-top: 0rem; margin-bottom: 0px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<span style=\"font-weight: 700;\">CHAMP&Uacute; PH NEUTRO,</span>&nbsp;a base de extractos vegetales de alta calidad (cal&eacute;ndula, de la hierba de San Juan y del &aacute;rbol del t&eacute;).Destinado a caballos, bovinos, perros y gato.Su f&oacute;rmula permite que penetre en la piel y limpie e hidrate el pelo.</p>', '', '', '', '', '', 46),
