(934, 1, 'BALSAMO DE CAVIAR IV SAN BERNARD', '', '<p>\r\n	<span style=\"color: rgb(69, 69, 69); font-family: Mali-Regular, sans-serif; font-size: 13px;\">Limpia cuidadosamente dando vitalidad a cualquier tipo de pelo. La acci&oacute;n conjunta del extracto de cavial unido a los oligop&eacute;ptidos y a los extractos del alga Fucus Vesiculosus, que contiene el&nbsp;Complexe Caviar&trade;, ayudan a fortalecer el pelo y a darle una textura compacta. La Vitamina F y los Omega 3 que contiene favorecen la integridad del pelo. Producto sin siliconas.</span></p>\r\n<p>\r\n	<span style=\"color: rgb(51, 47, 48); font-family: Mali-Regular, sans-serif; font-size: 14px;\">Modo de uso:</span></p>\r\n<p>\r\n	<span style=\"color: rgb(51, 47, 48); font-family: Mali-Regular, sans-serif; font-size: 14px;\">Aplicar el Champ&uacute; Caviar en el pelo h&uacute;medo y masajear, aclarar y aplicar el B&aacute;lsamo Caviar.</span><br style=\"box-sizing: border-box; color: rgb(51, 47, 48); font-family: Mali-Regular, sans-serif; font-size: 14px;\" />\r\n	<br style=\"box-sizing: border-box; color: rgb(51, 47, 48); font-family: Mali-Regular, sans-serif; font-size: 14px;\" />\r\n	<span style=\"color: rgb(51, 47, 48); font-family: Mali-Regular, sans-serif; font-size: 14px;\">Preparaci&oacute;n expo:</span><br style=\"box-sizing: border-box; color: rgb(51, 47, 48); font-family: Mali-Regular, sans-serif; font-size: 14px;\" />\r\n	<span style=\"color: rgb(51, 47, 48); font-family: Mali-Regular, sans-serif; font-size: 14px;\">Se aconseja seguir este tratamiento al menos 45 d&iacute;as antes de la competici&oacute;n y repetirlo 3 veces combin&aacute;ndolo con el resto de productos de la l&iacute;nea Caviar para obtener resultados &oacute;ptimos en el ring.</span><br style=\"box-sizing: border-box; color: rgb(51, 47, 48); font-family: Mali-Regular, sans-serif; font-size: 14px;\" />\r\n	<br style=\"box-sizing: border-box; color: rgb(51, 47, 48); font-family: Mali-Regular, sans-serif; font-size: 14px;\" />\r\n	<span style=\"color: rgb(51, 47, 48); font-family: Mali-Regular, sans-serif; font-size: 14px;\">300 ml. &ndash; 1 lt.</span></p>', '', '', '', '', '', 57),
