 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Montserrat, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102);\">\r\n	Dale a tu cachorro la cantidad de pienso recomendada en la tabla teniendo en cuenta su edad y su peso. Hasta los 4 meses debes mezclar 1 parte de agua por 3 de alimento y dividirlo en 4 o 5 tomas al d&iacute;a. Despu&eacute;s reduce de manera gradual las tomas hasta darle 2 comidas al d&iacute;a</p>', '', '', '', '', '', 47),
(937, 1, 'LIBRA PUPPY 15KG', '', '<div class=\"info\" style=\"margin: 0px 0px 2rem; padding: 0px; box-sizing: border-box; font-family: ECIFont, Arial, sans-serif; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; font-size: 14px; line-height: 1.6; color: rgb(51, 51, 51);\">\r\n	<ul class=\"info-list\" style=\"margin: 0px 0px 1em; padding-right: 0px; padding-left: 0px; box-sizing: border-box; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; list-style: none;\">\r\n		<li class=\"info-item\" style=\"margin: 0px 0px 5px; padding: 0px; box-sizing: border-box; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; display: block; text-align: justify;\">\r\n			Alimento completo y equilibrado especialmente formulado para cachorros (2-12 meses) y para hembras en per&iacute;odo de gestaci&oacute;n y de lactancia.</li>\r\n		<li class=\"info-item\" style=\"margin: 0px 0px 5px; padding: 0px; box-sizing: border-box; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; display: block; text-align: justify;\">\r\n			Beneficios: Crecimiento saludable. Alta digestibilidad. &Oacute;ptimo desarrollo cerebral y de la visi&oacute;n.</li>\r\n		<li class=\"info-item\" style=\"margin: 0px 0px 5px; padding: 0px; box-sizing: border-box; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; display: block; text-align: justify;\">\r\n			Componentes anal&iacute;ticos: Prote&iacute;na 30%, Contenido de grasa 16%, Fibras brutas 2,2%, Materia inorg&aacute;nica 7,5%, Calcio 1,6%, F&oacute;sforo 1,1%, Humedad 10%. Aditivos nutricionales/kg: Vitamina A 24000 IU, Vitamina D3 1600 IU, Vitamina E 75 mg, Sulfato ferroso monohidratado (Fe: 78 mg) 237 mg, Sulfato de zinc monohidratado (Zn: 196 mg) 360 mg, Selenito de sodio (Se: 0,15 mg) 0,22 mg.</li>\r\n		<li class=\"info-item\" style=\"margin: 0px 0px 5px; padding: 0px; box-sizing: border-box; -webkit-font-smoothing: antialiased; text-rendering: optimizel