(939, 1, 'BOLSA CACA 1UN', '', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(5, 0, 32); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	Doble grosor.&nbsp;Especialmente indicadas para perros de tama&ntilde;o mediano y grande. Aroma a lim&oacute;n.<br style=\"box-sizing: border-box;\" />\r\n	rollos de 15 unidades cada uno.<br style=\"box-sizing: border-box;\" />\r\n	&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(5, 0, 32); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	Las Bolsa Higienica Extra Gruesa Reciclable Olor A Limon Royo 15Bolsas son el accesorio que no debe faltar en tu paseo para recoger las heces de tu perro sin problemas. Se trata de una bolsa gruesa, de tama&ntilde;o grande y resistente especialmente fabricadas para las deposiciones de perros grandes.</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(5, 0, 32); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	Adem&aacute;s de grandes, gruesas y resistentes, las&nbsp;Bolsa Higienica Extra Gruesa Reciclable Olor A Limon Royo 15 Bolsas son respetuosas con el medioambiente ya que son biodegradables.</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.625rem; color: rgb(5, 0, 32); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	Con este tipo de bolsa es m&aacute;s llevadero recoger las heces de tu perro porque tienen un olor a lim&oacute;n.</p>', '', '', '', '', '', 45),
