(861, 1, 'snack calming mediterranean', '', '<p style=\"box-sizing: border-box; overflow-wrap: break-word; margin: 0px 0px 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Lato, Arial, Helvetica, sans-serif; font-size: 14px; vertical-align: baseline; color: rgb(119, 119, 119);\">\r\n	Los Functional Snacks son una gama de premios de funcionales. Son complementos alimenticios en forma de snack que ayudan a mejorar la salud del perro.</p>\r\n<p style=\"box-sizing: border-box; overflow-wrap: break-word; margin: 0px 0px 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Lato, Arial, Helvetica, sans-serif; font-size: 14px; vertical-align: baseline; color: rgb(119, 119, 119);\">\r\n	El Functional Snack Antiestr&eacute;s, est&aacute; elaborado con carne y pescado provenientes de la cadena de alimentaci&oacute;n humana. Sin gluten, colorantes artificiales, transg&eacute;nicos ni &aacute;cidos grasos trans.</p>\r\n<p style=\"box-sizing: border-box; overflow-wrap: break-word; margin: 0px 0px 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Lato, Arial, Helvetica, sans-serif; font-size: 14px; vertical-align: baseline; color: rgb(119, 119, 119);\">\r\n	Es un snack saludable hipoalerg&eacute;nico y fuente natural de &aacute;cido oleico. F&aacute;cilmente digerible y de alta palatabilidad, son muy blanditos, se parten con facilidad en porciones m&aacute;s peque&ntilde;as. Por lo que es perfectamente adecuado para perros de todos los tama&ntilde;os y senior.</p>\r\n<p style=\"box-sizing: border-box; overflow-wrap: break-word; margin: 0px 0px 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Lato, Arial, Helvetica, sans-serif; font-size: 14px; vertical-align: baseline; color: rgb(119, 119, 119);\">\r\n	Perfectos para entrenamiento, educaci&oacute;n y adiestramiento. Con cierre zip para mejor conservaci&oacute;n.</p>\r\n<p style=\"box-sizing: border-box; overflow-wrap: break-word; margin: 0px 0px 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Lato, Arial, Helvetica, sans-serif; font-size: 14px; vertical-align: baseline; color: rgb(119, 119, 119);\">\r\n	Composici&oacute;n:<br style=\"box-sizing: border-box;\" />\r\n	Carne 65% (jam&oacute;n serrano, carne de pollo, carne de buey), arroz, glicerina vegetal, salm&oacute;n y at&uacute;n, extracto de manzanilla (1%), extracto de pasiflora (1%). Aditivos: &aacute;cido c&iacute;trico. Vitamina A 10332ui, Vitamina D3 1920ui, vitamina E (alpha tocoferol) 24.2ui. Antioxidantes: aceite de or&eacute;gano, romero, levadura de cerveza.</p>\r\n<p style=\"box-sizing: border-box; overflow-wrap: break-word; margin: 0px 0px 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Lato, Arial, Helvetica, sans-serif; font-size: 14px; vertical-align: baseline; color: rgb(119, 119, 119);\">\r\n	Componentes anal&iacute;ticos:<br style=\"box-sizing: border-box;\" />\r\n	Prote&iacute;na: 26.4%, grasa bruta: 8.3%, ceniza bruta: 13.7%, fibra: 0.99%, humedad: 16.1%, 321 Kcal/100g., calcio 3.6g/100g, f&oacute;sforo 1.8g/100g, magnesio 0.18g/100g, hierro 0.03g/100g, zinc 0.11g/kg., cobre 0.03g/kg. omega 3 0,15g/100g, omega 6: 0,77g/100g, acido oleico &#148;omega 9&#148;: 1.97g/100g</p>', '', '', '', '', '', 46),
