(609, 1, 'POUCH TURKEY AND CHICKEN OWNAT GRAIN FREE 85GR', '', '<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119);\">\r\n	Componentes anal&iacute;ticos:</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119);\">\r\n	Prote&iacute;na 10,4%, Contenido en grasa 5,4%, Fibras brutas 0,3%, Materia inorg&aacute;nica 2,5%, Humedad 79%.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119);\">\r\n	ADITIVOS/KG: Aditivos nutricionales:</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119);\">\r\n	Vitamina D3 200 UI, Vitamina E 20 UI, Taurina 1.500 mg, Zinc (sulfato de zinc, monohidratado) 25 mg, Manganeso (sulfato manganoso, monohidratado) 1,4 mg, Cobre (sulfato de cobre (II), pentahidratado) 1 mg, Iodo (yodato de calcio anhidro) 0,75 mg.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119);\">\r\n	Instrucciones</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119);\">\r\n	Una vez abierto, mantener refrigerado como m&aacute;x. 24 horas. Servir a temperatura ambiente.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; min-height: 1px; color: rgb(119, 119, 119);\">\r\n	Tabla de racionamiento</p>\r\n<table border=\"0\" style=\"margin: 0px; padding: 0px; border-width: 0px; border-style: initial; border-color: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 13px; vertical-align: baseline; border-collapse: collapse; border-spacing: 0px; max-width: 100%; color: rgb(119, 119, 119);\">\r\n	<tbody style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n		<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">\r\n			<td style=\"box-sizing: border-box; margin: 0px; padding: 9px 10px; border-width: 0px; border-style: initial; b