ducto puro, por pulverizaci&oacute;n. Aplicar el producto puro en ausencia de animales. No introducir los animales hasta asegurarse que el &aacute;rea tratada est&aacute; suficientemente ventilada. No utilizar sobre los animales.</span></li>\r\n	<li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px;\">\r\n		<span class=\"a-list-item\" style=\"box-sizing: border-box;\">Este producto es apto para uso por el p&uacute;blico en general. N&uacute;mero de registro zoosanitario: 0372-P. Utilice los biocidas de forma segura. Lea siempre la etiqueta y la informaci&oacute;n sobre el biocida antes de usarlo</span></li>\r\n	<li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px;\">\r\n		<span class=\"a-list-item\" style=\"box-sizing: border-box;\">Rango de edad: todas las etapas de la vida</span></li>\r\n</ul>', '', '', '', '', '', 134),
